var Groovehack;

Groovehack = new Backbone.Marionette.Application();

Groovehack.addRegions({
  headerRegion: '#header-region',
  mainRegion: '#main-region',
  footerRegion: '#footer-region',
  dialogRegion: '#dialog-region'
});

Groovehack.addInitializer(function() {
  console.log('Groovehack::initialize');
  return this;
});

Groovehack.navigate = function(route, options) {
  if (options == null) {
    options = {};
  }
  return Backbone.history.navigate(route, options);
};

Groovehack.getCurrentRoute = function() {
  return Backbone.history.fragment;
};

Groovehack.on('start', function() {
  if (Backbone.history) {
    Backbone.history.start();
    if (this.getCurrentRoute() === "") {
      return Groovehack.trigger('welcome:show');
    }
  }
});

$(function() {
  return Groovehack.start();
});

